import React from 'react'

function AssetsGallery() {
  return (
    <div> 
        <p>NFT Assets Gallery</p>
        {data.data.map((item, index)=> (
            <div key={index}>
                <img src={item.link} alt={item.text}/>
                <h2>item.text</h2>
            </div>    
        ))}
    </div>

  )
}

export default AssetsGallery
